import React from "react";
import { Text, StyleSheet, View } from "react-native";

export default function Index() {
  return (
    <View>
      <Text
        style={{
          marginTop: 100,
          fontSize: 25,
          color: "#000",
          backgroundColor: "#000",
        }}
      >
        Pagina home
      </Text>
    </View>
  );
}

const styles = StyleSheet.create({});
